import React, { useState } from 'react';
import axios from 'axios';
import '../styles/RegisterPage.css';

const RegisterPage = () => {
  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');
  const [phone, setPhone] = useState('');
  const [email, setEmail] = useState('');
  const [key, setKey] = useState('');
  const [password, setPassword] = useState('');
  const [passwordConfirmation, setPasswordConfirmation] = useState('');
  const [error, setError] = useState('');
  const [isRegister, setIsRegister] = useState(true); // Bu state ile formu değiştireceğiz

  const handleRegister = async (e) => {
    e.preventDefault();

    if (password !== passwordConfirmation) {
      setError('Şifreler eşleşmiyor.');
      return;
    }

    try {
      const userData = {
        name,
        surname,
        phone,
        email,
        key,
        password,
      };

      await axios.post('/api/kullanici/kayit', userData);
      alert('Kayıt başarılı!');
      setIsRegister(false); // Kayıt başarılı olduğunda giriş yap formuna geç
    } catch (err) {
      setError('Bir hata oluştu. Lütfen tekrar deneyin.');
    }
  };

  const handleLogin = async (e) => {
    e.preventDefault();
    // Giriş işlemi kodunu buraya ekle
  };

  return (
    <div className="register-container">
      <h2>{isRegister ? 'Kayıt Ol' : 'Giriş Yap'}</h2>
      {error && <div className="error">{error}</div>}
      
      {/* Kayıt formu */}
      {isRegister ? (
        <form onSubmit={handleRegister}>
          <div className="input-group">
            <label>Ad</label>
            <input type="text" value={name} onChange={(e) => setName(e.target.value)} required placeholder="Adınızı girin" />
          </div>
          <div className="input-group">
            <label>Soyad</label>
            <input type="text" value={surname} onChange={(e) => setSurname(e.target.value)} required placeholder="Soyadınızı girin" />
          </div>
          <div className="input-group">
            <label>Telefon</label>
            <input type="text" value={phone} onChange={(e) => setPhone(e.target.value)} required placeholder="Telefon numaranızı girin" />
          </div>
          <div className="input-group">
            <label>Email</label>
            <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required placeholder="Email adresinizi girin" />
          </div>
          <div className="input-group">
            <label>Key (Opsiyonel)</label>
            <input type="text" value={key} onChange={(e) => setKey(e.target.value)} placeholder="Key (Opsiyonel)" />
          </div>
          <div className="input-group">
            <label>Şifre</label>
            <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} required placeholder="Şifrenizi girin" />
          </div>
          <div className="input-group">
            <label>Şifre Tekrarı</label>
            <input type="password" value={passwordConfirmation} onChange={(e) => setPasswordConfirmation(e.target.value)} required placeholder="Şifrenizi tekrar girin" />
          </div>
          <button type="submit" className="register-btn">Kayıt Ol</button>
        </form>
      ) : (
        /* Giriş Yap formu */
        <form onSubmit={handleLogin}>
          <div className="input-group">
            <label>Email</label>
            <input type="email" required placeholder="Email adresinizi girin" />
          </div>
          <div className="input-group">
            <label>Şifre</label>
            <input type="password" required placeholder="Şifrenizi girin" />
          </div>
          <button type="submit" className="register-btn">Giriş Yap</button>
        </form>
      )}
      
      <p style={{ textAlign: 'center', marginTop: '12px' }}>
        {isRegister ? 'Zaten hesabınız var mı? ' : 'Hesabınız yok mu? '}
        <a href="#" onClick={(e) => {
          e.preventDefault();
          setIsRegister(!isRegister); // Formları değiştir
        }}>
          {isRegister ? 'Giriş yap' : 'Kayıt ol'}
        </a>
      </p>
    </div>
  );
};

export default RegisterPage;
